  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:51.417389\",\n\t\"name\": \"valentine-national-wildlife-refuge-annual-narrative-report-calendar-year-1986\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Valentine
  NWR outlines Refuge accomplishments during the 1986 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, volunteer programs, funding, safety, and technical
  assistance is given. Habitat management is also covered; subjects include wetlands,
  grasslands, grazing, haying, fire management, pest control, and wilderness areas.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, fisheries resources, scientific collections, animal control, and marking
  and bird banding. The public uses of the Refuge described in this report include
  outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
  observation, and law enforcement. The equipment and facilities section of the report
  provides information about new construction, rehabilitation, major maintenance,
  and equipment replacement. Items of interest are provided at the end. Refuge brochures
  and field guides are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
